import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    const screenshots = [];
    const step1 = path.join(screenshotsDir, 'step_1_initial.png');
    await page.screenshot({ path: step1 });
    screenshots.push(step1);

    // Open the cart modal by clicking the cart icon using text selector
    await page.waitForSelector('text=Cart', { timeout: 5000 });
    // There may be multiple "Cart" texts, so use the div with class "cart"
    const cartDiv = await page.$('div.cart');
    if (!cartDiv) throw new Error('Cart icon not found');
    await cartDiv.click();

    // Wait for cart modal/dialog to appear by looking for "Your cart" or cart item
    // Try to wait for a cart item quantity button (e.g., "-") to appear
    await page.waitForSelector('.cart-item-quantity .quantity-btn', { timeout: 5000 });

    // Take screenshot after opening cart
    const step2 = path.join(screenshotsDir, 'step_2_cart_opened.png');
    await page.screenshot({ path: step2 });
    screenshots.push(step2);

    // Find the first cart item's "+" button and click it to increase quantity
    const plusBtn = await page.$('.cart-item-quantity .quantity-btn:nth-of-type(2)');
    if (!plusBtn) throw new Error('Cart item "+" button not found');
    await plusBtn.click();

    // Wait for the quantity to update (look for the quantity span)
    await page.waitForSelector('.cart-item-quantity .quantity', { timeout: 5000 });
    const quantitySpan = await page.$('.cart-item-quantity .quantity');
    const newQuantity = await quantitySpan.textContent();

    // Take screenshot after updating quantity
    const step3 = path.join(screenshotsDir, 'step_3_quantity_updated.png');
    await page.screenshot({ path: step3 });
    screenshots.push(step3);

    // Extract updated cart item data
    // Get the cart item title and new quantity
    const cartItemTitle = await page.$eval('.cart-item-title', el => el.textContent.trim());
    const updatedQuantity = parseInt(newQuantity);

    return {
      success: true,
      action: "Updated cart item quantity by increasing it using the '+' button in the cart modal",
      extractedData: {
        cartItemTitle,
        updatedQuantity
      },
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to complete task",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}
